import { Injectable } from '@angular/core';
import { SelectionModel } from '@angular/cdk/collections';

export interface Item {
  name: string;
  image: string;
}

@Injectable({
  providedIn: 'root'
})
export class SelectionService {

  multipleSelection: boolean = true;

  items: Item[] = [
    { 
      name: 'Nubank', 
      image: 'data:image/jpeg;base64,'
    },
    { 
      name: 'Bradesco', 
      image: 'data:image/jpeg;base64,' 
    },
    { 
      name: 'Caixa', 
      image: 'data:image/jpeg;base64,' 
    },
    { 
      name: 'Santander', 
      image: 'data:image/jpeg;base64,'
    },
    { 
      name: 'Banco do Brasil', 
      image: 'data:image/jpeg;base64,' 
    },
  ]

  // Without CDK
  dadosSelecionados: Item[] = [];

  // SelectionModel CDK
  dadosSelecionadosModel: SelectionModel<Item> = new SelectionModel(this.multipleSelection);

  constructor() { }

  // Without CDK
  getItems(): Item[] {
    return this.items;
  }

  getItemIndex(item: Item): number {
    return this.dadosSelecionados.findIndex((itemSelecionado: Item) => itemSelecionado.name === item.name);
  }

  isSelectionEmpty(): boolean {
    return this.dadosSelecionados.length <= 0;
  }

  updateSelection(item: Item, checked: boolean): void {
    let itemIndex = this.getItemIndex(item);

    if (!this.multipleSelection) {
      this.resetSelection();
    }
    if (itemIndex >= 0 && !checked) {
      this.dadosSelecionados.splice(itemIndex, 1);
    } else if (itemIndex < 0 && checked) {
      this.dadosSelecionados.push(item);
    }
  }

  isSelected(item: Item): boolean {
    return this.getItemIndex(item) >= 0;
  }

  resetSelection(): void {
    this.dadosSelecionados = [];
  }
}
